import React from "react";
import BannerImage from "../Banner-Image /image-banner";
import img from "../../src/assest/cycle.png";

const Banner = () => {
  return (
    <div>
      <BannerImage
        src={img}
        aspectRatio={{ desktop: "1920:923", mobile: "360:736" }}
      />
    </div>
  );
};

export default Banner;
